import React from "react";
import "./SideBar.css";
import SideBarHeader from "./SideBarHeader";
import SideBarChat from "./SideBarChat";

const SideBar = () => {
  return (
    <div className="sidebar">
      <SideBarHeader />
      <SideBarChat />
    </div>
  );
};

export default SideBar;
